import React from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import store from "./store/reducers/store";
import App from "./App";
const rootElement = document.getElementById("root");
ReactDOM.render(
  <Provider store={store}>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Provider>,
  rootElement
);
